void map(void)
{
    uint8 i,j;
    uint8* pp = NULL;
    uint8* ss = NULL;
    pp = &left_side[0];
    ss = &right_side[0];
    uint8* str = NULL;
    uint8* ptr = NULL;
    str = &img_original[0][0];//变换后数组img_original
    ptr = fullBuffer;//变换前数组image_Buffer_0
    uint8* pptr = NULL;
    uint8* sstr = NULL;
    pptr = &i_fix[0];
    sstr = &j_fix[0][0];
    int j_begin, j_end;
    uint8* tstr = NULL;
    uint8* tsstr = NULL;
    uint8* tptr = NULL;
    for (i = 0; i < CAMERA_H; i++)
    {
        j_begin = *(pp + i);
        j_end = *(ss + i);
        tstr = str + i * 188;
        tsstr = sstr + i * 188;
        tptr = ptr + *(pptr + i) * 188;
        for (j = j_begin; j <= j_end; j++)
        {
            *(tstr + j) = *(tptr + *(tsstr + j));
        }
    }
}

